import Committee from '../views/Committee';
import Home from '../views/Home';

const Routes = [
  {
    path: '/home',
    sidebarName: 'Home',
    component: Home,
  },
  {
    path: '/committee',
    sidebarName: 'Committee',
    component: Committee,
  },

];

export default Routes;
